import React, {useEffect, useState} from "react";
import {getAuctionByClient} from "../../services/EnchereService";

export default function MyAuctions(){
    const [data, setData] = useState(null);
    const [load, isLoad] = useState(false)

    useEffect(()=>{
        let id = sessionStorage.getItem("client")
        getAuctionByClient(id).then(res=>{
            setData(res.data)
            isLoad(true)
            console.log(res.data)
        })
    })

    if (!load){
        return (
            <div className="preloader">
                <div className="loader">
                    <span></span>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        )
    }else{
        return(
            <div className="table-wrapper">
                <table className="eg-table order-table table mb-0">
                    <thead>
                    <tr>
                        <th>Image</th>
                        <th>Bidding ID</th>
                        <th>Bid Amount(USD)</th>
                        <th>Highest Bid</th>
                        <th>Status</th>
                        <th>Action</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td data-label="Image"><img alt="image" src="assets/images/bg/order1.png" className="img-fluid" />
                        </td>
                        <td data-label="Bidding ID">Bidding_HvO253gT</td>
                        <td data-label="Bid Amount(USD)">1222.8955</td>
                        <td data-label="Highest Bid">$1222.8955</td>
                        <td data-label="Status" className="text-green">Approved</td>
                        <td data-label="Action">
                            <button className="eg-btn action-btn green">Details</button>
                        </td>
                    </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}
